import { useEffect } from "react";
import Header from "./header";
import Main from "./main";

function App() {
  useEffect(() => {
    async function getData() {
      const res = await fetch("http://localhost:9000/questions");
    }
    getData();
  });
  return (
    <div className="app">
      <Header />
      <Main>
        <h3>Welcome to the react Quiz</h3>
        <p>15 questions</p>
      </Main>
    </div>
  );
}

export default App;
